        self.label_2.setText(_translate("MainWindow", "<html><head/><body><p><span style=\" font-size:14pt; font-weight:600;\">NEBP Ground Station Tracker</span></p><p>This software is designed to track a high-altitude balloon in-flight and control the automatic antenna-pointing system developed by the Nationwide Eclipse Ballooning Project for the 2023 annular and 2024 total solar eclipses.</p></body></html>"))
        self.label_3.setText(_translate("MainWindow", "<html><head/><body><p><span style=\" font-size:14pt; font-weight:600;\">How to Use:</span></p><p><span style=\" font-weight:600;\">Physical Setup</span></p><p>1. Set up and level the tripod in a suitable location</p><p>2. Place the ground station unit on top of the tripod and screw the tripod into the hole in the base of the ground station</p><p>3. Plug in the ground station and connect it to the laptop</p><p><span style=\" font-weight:600;\">Software Setup</span></p><p>1. On the Tracking Source/Arduino page, select the desired tracking method, and enter and confirm the information required for it. There will be a pause while the software tests the tracking source, this is expected</p><p>2. Select the Arduino device (typically /dev/ttyACM0) and connect to it</p><p>3. On the Location/Orientation page, enter the latitude, longitude, and altitude of the ground station location and click the set button. There will be a pause while the software redraws the map, this is expected</p><p>4. Use the tilt controls to point the head of the ground station at either the Sun or level and facing North</p><p>5. If pointing at the Sun, click the Calculate Starting Position button to calculate a vector to the Sun from the ground station location, then click the set button. If pointing North, enter 0 for both azimuth and elevation and click the set button</p><p>6. Click Start Basic Tracking to begin pointing at the balloon</p><p>7. When finished, click Stop Tracking, use the tilt controls to straighten out the head for storage, and disconnect, shut down, and pack up the ground station and tripod</p><p><br/></p></body></html>"))
